import './style.css';

class App extends React.Component {
    render() {
        return(
            <header className = "header">
                <h1 className = "title">Crypto Tracker</h1>
                <h2 className = "subtitle">A minimalist cryptocurrency ticker and nothing else.</h2>
            </header>
        );
    }
}

export default App;
